import React from 'react';
import PostCard from './PostCard';
import { Card } from 'semantic-ui-react'


const Posts = (props) => {
  const { postsData } = props;

  const postsElements = postsData.map(post => <PostCard key={post.id} post={post}/>)

  return (
    <Card.Group centered>
        {postsElements}
    </Card.Group>
  );
}

export default Posts;
